    print("\n===== SIMULASI TRANSAKSI =====")
    try:
        trx_budi_aktif = next((trx for trx in perpustakaan_utama.daftar_transaksi if trx.member.member_id == member_budi.member_id and trx.item.item_id == "BK-001" and trx.status == StatusTransaksi.AKTIF), None)
